export const signUp = async (req, res) =>{
  const { email, password, fullname } = await req.body;

  const user = new User({
    email,
    password: await User.encryptPassword(password),
    fullname
  })

  await user.save();

  res.status(200).json({msg: 'ok'})
}


export const signIn = async (req, res) => {}

